import React, { PureComponent } from 'react';
import { BarChart, Bar, Cell, XAxis, YAxis, CartesianGrid, Tooltip, Legend, ResponsiveContainer } from 'recharts';

const data = [
  {
    name: 'Page A', value: 1
  },
  {
    name: 'Page B', value: 4
  },
  {
    name: 'Page C', value: 5
  },
  {
    name: 'Page D', value: 3
  },
  {
    name: 'Page E', value: 3
  }
];

const renderCustomAxisTick = ({x, y, payload}) => {
  let path = '';

  switch (payload.value) {
    case '1':
      path = 'Beginner'
      break;
    case '4':
      path = 'Intermediate'
      break;
    case '5':
      path = 'Expert'
      break;
    default: 
      path = 'Hello';
  }

  return (
      <text>{path}</text>
  )
};

class Example extends PureComponent {
  render() {
    return (
      <div> 
        <BarChart
          width={500}
          height={500}
          data={data}
          layout="vertical"
          margin={{
            top: 5,
            right: 30,
            left: 20,
            bottom: 5,
          }}
        >
          <CartesianGrid strokeDasharray="3 3" />
          <XAxis type="number" interval={0} domain={[0,5]} tick={renderCustomAxisTick}/>
          <YAxis type="category" dataKey="name" />
          <Tooltip />
          <Bar dataKey="value" fill="#8884d8"/>
        </BarChart>
      </div>
    );
  }
}

export default Example
